// ACILexerInit initializes any static state used to implement ACILexer. By default the
// static state used to implement the lexer is lazily initialized during the first call to
// NewACILexer(). You can call this function if you wish to initialize the static state ahead
// of time.
func ACILexerInit() {
	staticData := &ACILexerLexerStaticData
	staticData.once.Do(acilexerLexerInit)
}

// NewACILexer produces a new lexer instance for the optional input antlr.CharStream.
func NewACILexer(input antlr.CharStream) *ACILexer {
	ACILexerInit()
	l := new(ACILexer)
	l.BaseLexer = antlr.NewBaseLexer(input)
	staticData := &ACILexerLexerStaticData
	l.Interpreter = antlr.NewLexerATNSimulator(l, staticData.atn, staticData.decisionToDFA, staticData.PredictionContextCache)
	l.channelNames = staticData.ChannelNames
	l.modeNames = staticData.ModeNames
	l.RuleNames = staticData.RuleNames
	l.LiteralNames = staticData.LiteralNames
	l.SymbolicNames = staticData.SymbolicNames
	l.GrammarFileName = "ACILexer.g4"
	// TODO: l.EOF = antlr.TokenEOF

	return l
}

